import axios from "axios";
import React from "react";
import { Button } from 'reactstrap';
import './styles/SingleReport.css'

function SignleReport({ key, state, reportType, message, reps, setReps }) {

    function deleteHandler(id) {
        axios.delete('/delete/' + id);
        alert('')
    }

    return <div>
        <tr>
            <td>ID: {key}</td>
        </tr>
        <tr>
            <td>State: {state}</td>
        </tr>
        <tr>
            <td>Type: {reportType}</td>
        </tr>
        <tr>
            <td>Message: {message}</td>
        </tr>


        <Button  color="primary">Resolve</Button>

        <Button onClick={() => deleteHandler(reps._id)} color="danger">Block</Button>

    </div>
}

export default SignleReport;
